import React from "react";

const sideBar = () => {
    return (
        <div className="sidebar">
            <li>한식</li>
            <li>중식</li>
            <li>일식</li>
            <li>양식</li>
            <li>카페 / 디저트</li>
        </div>
    )
}

export default sidebar;
